import React from "react";
import { Button, Icon } from "react-materialize";

const Header = props => {
    return(
        <Button 
            node="button"
            type="submit"
            waves="light"
            style={{...styles.button, ...props.style}}
            >Submit
                <Icon right>
                    send
                </Icon>
            </Button>
    )
};

const styles = {
    button: {
        backgroundColor: "#FFF123",
        color: "black"
    }
}

export default Header;
